.dropdown-menu {
  position: relative; }
  .dropdown-menu .dropdown-menu-trigger {
    transition-delay: 0ms;
    transition-duration: 150ms;
    transition-property: opacity, transform, background, color, box-shadow;
    transition-timing-function: cubic-bezier(0.4, 0, 0.2, 1);
    text-align: left;
    padding-right: 48px;
    border-radius: 4px;
    height: 48px;
    font: italic 500 1.26em "Roboto condensed"; }
    .dropdown-menu .dropdown-menu-trigger .mdi {
      position: absolute;
      right: 16px;
      top: 50%;
      transform: translateY(-50%); }
  .dropdown-menu .dropdown-menu-content {
    position: absolute;
    transition-delay: 0ms;
    transition-duration: 150ms;
    transition-property: opacity, transform, background, color, box-shadow;
    transition-timing-function: cubic-bezier(0.4, 0, 0.2, 1);
    opacity: 0;
    pointer-events: none;
    transform: translateY(-24px);
    top: calc(100% + 8px);
    min-width: 100%;
    right: 0;
    z-index: 10;
    display: flex;
    flex-direction: column;
    border-radius: 4px; }
    .dropdown-menu .dropdown-menu-content .dropdown-menu-item {
      line-height: 48px; }
    .dropdown-menu .dropdown-menu-content.reversed-menu {
      transform: translateY(24px); }
  .dropdown-menu.open .dropdown-menu-trigger {
    box-shadow: 8px 8px 0px rgba(14, 28, 38, 0.5); }
  .dropdown-menu.open .dropdown-menu-content {
    opacity: 1;
    pointer-events: auto;
    transform: none;
    box-shadow: 8px 8px 0px rgba(14, 28, 38, 0.5); }

